import { FiSearch, FiPlus, FiUser } from 'react-icons/fi';
import '../stylesheets/NaviBar.css';

function NaviBar() {
  const goSearch = () => {
    window.location.href = '/search';
  };
  const goProfile = () => {
    window.location.href = '/profile';
  };

  return (
    <>
      <nav>
        <button className="search-btn nav-btn">
          <FiSearch />
        </button>
        <button className="post-btn nav-btn">
          <FiPlus />
        </button>
        <button className="profile-btn nav-btn">
          <FiUser />
        </button>
      </nav>
    </>
  );
}

export default NaviBar;
